import styled from 'styled-components';

export const LinkingWrapper = styled.div`
  .selected {
    :after {
      content: '';
      display: block;
      position: absolute;
      left: 10%;
      height: 3px;
      border-radius: 4px;
      border-left: 50px solid black;
    }
  }
ul {
    list-style-type:none;
    display: flex;
}
li {
    display: flex;
    position: relative;
    font-size: 12px;
    margin-left: 10px;
    margin-right: 10px;
    a {
        text-decoration: none;
        color: black;
    }
}
  #navbar{
    display: flex;
    align-items: center;
    justify-content: space-between;
    background-color: aliceblue;
    border-bottom: solid;
  }
`
export const Image = styled.image`
  img {
    width: 30px;
    height: 30px;
    margin-left: 5px;
  }
`
